import React, {Component, useState} from 'react';


// Name, age, email, phone number, address, city, state, zipcode, sex
//Nine boxes for info
//Then 3 buttons for add, update, delete

class PatientForm extends Component {
    constructor(props) {
        super(props)

        this.state = {
            inputs: []
        }
    }

    PatientForm = props => {
        const [myNumber, setMyNumber] = useState(0);

        const onClickHandler = () => {
            setMyNumber(myNumber+1);
        }
        return(
            <div className ="form-inputs">
                <button>Add</button>
                <input required='true' placeholder='Name' type='text'></input>
                <input required='true' placeholder='Age'></input>
                <input required='true' placeholder='email@example.org'></input>
                <input required='true' placeholder='phone number: 000-000-0000'></input>
                <input required='true' placeholder='Street Address'></input>
                <input required='true' placeholder='City'></input>
                <input required='true' placeholder='State'></input>
                <input required='true' placeholder='Zip Code'></input>
                <input required='true' placeholder='Sex'></input>
                <button>Delete</button>
                <button>Update</button>
                <button onClick={onClickHandler} >{`${myNumber}`}</button>
            </div>
        )
    }
}

export default PatientForm;
